import React, { Component } from 'react';
import LylicBlock from './LylicBlock';

class YoutubeLylic extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    const block = '';
    for (let i = 0; i < this.props.count; i++) {
      block += <LylicBlock />;
    }
    return <div>{block}</div>;
  }
}

export default YoutubeLylic;
